var blog=angular.module("blog",["ngRoute"],function(r,t){t.html5Mode(!0),r.when("/:partial*",{controller:"PageCtrl",templateUrl:function(r){return"/partial/"+r.partial}}).when("/",{controller:"PageCtrl",templateUrl:"/partial/index.html"})});blog.controller("PageCtrl",function(r,t){r.$on("$routeChangeStart",function(){t.NProgress.start()}),r.$on("$routeChangeSuccess",function(){t.NProgress.done()}),r.$on("$routeChangeError",function(){t.NProgress.done()})});